import React, { useState } from 'react'
import styled from "styled-components";
import '../../../src/App.css'

export default function Navbar() {
    // const navbar = ()=>{
    //     const [menu,srtMenu] = useState(false)
    // }
  return (

     <NavSection> 
        <NavContent>
        <NavLeft><Link><Image src={require('../Assets/images/images/Logo.png')} /></Link></NavLeft>
        <NavRight><Link><Image  src={require('../Assets/images/images/close.svg').default} /></Link></NavRight>
        </NavContent>
      
        <NavContainer>
            <NaItems>
                <Itemimg><Image src={require("../Assets/images/images/programs.svg").default}/></Itemimg>
                <Item><NavHeading><Link>Programs</Link></NavHeading></Item>
                <Item><Link>School Students</Link></Item>
                <Item><Link>College Students</Link></Item>
                <Item><Link>Graduates or Dropouts</Link></Item>
            </NaItems>
            <NaItems>
                <Itemimg><Image src={require("../Assets/images/images/company.svg").default}/></Itemimg>
                <Item><NavHeading><Link>Company</Link></NavHeading></Item>
                <Item><Link>About Us</Link></Item>
                <Item><Link>Contact Us</Link></Item>
            </NaItems>
            <NaItems>
                <Itemimg><Image src={require("../Assets/images/images/community.svg").default}/></Itemimg>
                <Item><NavHeading><Link>Community</Link></NavHeading></Item>
                <Item><Link>Free Ground</Link></Item>
                <Item><Link>Challenges</Link></Item>
            </NaItems>
        </NavContainer>
        <NavLinkBtn >Go to Dashboard</NavLinkBtn>
    </NavSection>
  )
}

const NavSection = styled.section`
    width: 100%;
    height: 100%;
    /* display: none; */
    
 @media all and (max-width:980px){
  
 }`
 
 const NavContent = styled.div `
    display: flex;
    justify-content:space-evenly;
    margin-top: 50px;`
 const Link = styled.a `
    display: block;
    cursor: pointer;`

 const NavLeft = styled.div `
    width: 100px;`

 const NavRight = styled.div `
    width: 20px;`

 const Image = styled.img `
    display: block;
    width: 100%;`

const NavContainer = styled.div `
    display: flex;
    justify-content:space-evenly;
    gap: 100px;
    width: 80%;
    padding-bottom: 60px;
    margin-top: 50px;
    border-bottom: 1px solid rgb(210, 247, 234);  `

const NaItems = styled.ul ``

const Item = styled.li `
    font-family: 'Gordita_Regular';
    margin-bottom: 10px;
    color: rgb(156, 156, 156);`

const NavHeading = styled.h4 `
  font-family: 'Gordita_bold';
  color: rgb(112, 112, 112);`

const Itemimg = styled.div `
    width: 40px;
    margin-bottom: 20px;
    margin-left: 0px;`
const NavLinkBtn = styled.a`
    margin-top: 50px;
    display: block;
    color: rgb(78, 175, 124);
    border: 2px solid rgb(78, 175, 124);
    border-radius: 5px;
    width: 16%;
    font-family: 'Gordita_bold';
    height: 20%;
    padding: 16px 0px;
    text-align: center;
    font-size: 16px;
    cursor: pointer;`
